import TinderCard from 'react-tinder-card';
import { useEffect, useState } from 'react';
import { useCookies } from 'react-cookie';
import ChatContainer from '../components/ChatContainer';
import axios from 'axios';

const Dashboard = () => {
    const [user, setUser] = useState(null);
    const [genderedUsers, setGenderedUsers] = useState(null);
    const [recommendedUsers, setRecommendedUsers] = useState([]); // Dodajemo stanje za preporučene korisnike
    const [cookies, setCookie, removeCookie] = useCookies(['user']);
    const [lastDirection, setLastDirection] = useState();

    const userId = cookies.UserId;

    const getUser = async () => {
        try {
            const response = await axios.get('http://localhost:8000/user', {
                params: { userId },
            });
            setUser(response.data);
        } catch (error) {
            console.log(error);
        }
    };

    const getGenderedUsers = async () => {
        try {
            const response = await axios.get('http://localhost:8000/gendered-users', {
                params: { gender: user?.gender_interest },
            });
            setGenderedUsers(response.data);
        } catch (error) {
            console.log(error);
        }
    };

    // Nova funkcija za dohvatanje preporučenih korisnika
    const getRecommendedUsers = async () => {
        try {
            const response = await axios.get('http://localhost:8000/recommended-users', {
                params: { userId },
            });
            setRecommendedUsers(response.data);
        } catch (error) {
            console.log(error);
        }
    };

    useEffect(() => {
        getUser();
    }, []);

    useEffect(() => {
        if (user) {
            getGenderedUsers();
            getRecommendedUsers(); // Dodaj dohvatanje preporučenih korisnika
        }
    }, [user]);

    const updateMatches = async (matchedUserId) => {
        try {
            await axios.put('http://localhost:8000/addmatch', {
                userId,
                matchedUserId,
            });
            getUser();
        } catch (error) {
            console.log('error');
        }
    };

    const swiped = (direction, swipedUserId) => {
        if (direction === 'right') {
            updateMatches(swipedUserId);
        }
        setLastDirection(direction);
    };

    const outOfFrame = (name) => {
        console.log(name + ' left the screen!');
    };

    const matchedUserIds = user?.matches.map(({ user_id }) => user_id).concat(userId);

    const filteredGenderedUsers = genderedUsers?.filter(
        (genderedUser) => !matchedUserIds.includes(genderedUser.user_id)
    );

    const filteredRecommendedUsers = recommendedUsers?.filter(
        (recommendedUser) => !matchedUserIds.includes(recommendedUser.user_id)
    );

    return (
        <>
            {user && (
                <div className="dashboard">
                    <ChatContainer user={user} />
                    <div className="swipe-container">
                        <div className="instructions">
                            <div className="left-instruction">
                                <p>Decline</p>
                                <span>&larr;</span> {/* Strelica lijevo */}
                            </div>
                            <div className="right-instruction">
                                <p>Match</p>
                                <span>&rarr;</span> {/* Strelica desno */}
                            </div>
                        </div>
                        <div className="card-container">
                            {filteredGenderedUsers?.map((genderedUser) => (
                                <TinderCard
                                    className="swipe"
                                    key={genderedUser.user_id}
                                    onSwipe={(dir) => swiped(dir, genderedUser.user_id)}
                                    onCardLeftScreen={() => outOfFrame(genderedUser.first_name)}>
                                    <div
                                        style={{ backgroundImage: 'url(' + genderedUser.url + ')' }}
                                        className="card">
                                        <h3>{genderedUser.first_name}</h3>
                                    </div>
                                </TinderCard>
                            ))}
                            <div className="swipe-info">
                                {lastDirection ? <p>You swiped {lastDirection}</p> : <p />}
                            </div>
                        </div>
                    </div>

                    {/* Sekcija za preporučene korisnike */}
                    <div className="recommended-users">
                        <h2>Recommended Users</h2>
                        <div className="recommended-container">
                            {filteredRecommendedUsers?.map((recommendedUser) => (
                                <TinderCard
                                    className="swipe"
                                    key={recommendedUser.user_id}
                                    onSwipe={(dir) => swiped(dir, recommendedUser.user_id)}
                                    onCardLeftScreen={() => outOfFrame(recommendedUser.first_name)}>
                                    <div
                                        style={{ backgroundImage: 'url(' + recommendedUser.url + ')' }}
                                        className="card">
                                        <h3>{recommendedUser.first_name}</h3>
                                    </div>
                                </TinderCard>
                            ))}
                        </div>
                    </div>
                </div>
            )}
        </>
    );
};

export default Dashboard;
